package main

import (
	"crypto/md5"
	"encoding/json"
	"fmt"
	"io/ioutil"
	"log"
	"net/http"
	"net/url"
	"sort"
	"strconv"
	"strings"
	"time"
)

type AddressInfo struct {
	Lat      string `json:"lat"`
	Lng      string `json:"lng"`
	Location string `json:"location"`
}

type EventReq struct {
	CompanyId   int         `json:"com_id"`
	CompanyKey  string      `json:"com_key"`
	Platform    string      `json:"platform"`
	SignTime    int         `json:"signtime"`
	Sign        string      `json:"sign"`
	Pics        []string    `json:"pics"`
	AddressInfo AddressInfo `json:"address"`
	Content     string      `json:"content"`
	Level       string      `json:"level_name"`
	EventType   string      `json:"event_type_name"`
}

func MD5(s string) string {
	str := fmt.Sprintf("%x", md5.Sum([]byte(s)))
	fmt.Println(str)
	return str
}

func sortedMap(m map[string]interface{}, f func(k string, v interface{})) {
	var keys []string
	for k := range m {
		keys = append(keys, k)
	}
	sort.Strings(keys)
	for _, k := range keys {
		f(k, m[k])
	}
}

func Sign(req *EventReq, timeSecond int) string {
	jsonStr, _ := json.Marshal(req.AddressInfo)
	addressStr := string(jsonStr)
	fmtStr := fmt.Sprintf("address=%s&com_id=%d&com_key=%s&content=%s&event_type_name=%s&level_name=%s&signtime=%d",
		addressStr, req.CompanyId, req.CompanyKey, req.Content, req.EventType, req.Level, timeSecond)
	fmt.Println(fmtStr)
	encodeStr := url.QueryEscape(fmtStr)
	encodeStr = strings.ReplaceAll(encodeStr, "*", "%2A")
	encodeStr = strings.ReplaceAll(encodeStr, "+", "%20")
	encodeStr = strings.ReplaceAll(encodeStr, "%7E", "~")
	//URLEncoder.encode(params_str,"UTF-8").replace("*","%2A").replace("+","%20").replace("%7E","~");
	//md5((com_id + md5(params_encode_str) + com_key))
	sign := MD5(fmt.Sprintf("%s%s%s", strconv.Itoa(req.CompanyId), MD5(encodeStr), req.CompanyKey))
	return sign
}

func unicodeDecode(raw []byte) ([]byte, error) {
	str, err := strconv.Unquote(strings.Replace(strconv.Quote(string(raw)), `\\u`, `\u`, -1))
	if err != nil {
		return nil, err
	}
	return []byte(str), nil
}

func main() {
	timeSecond := int(time.Now().UnixNano() / 1e6)
	log.Println(timeSecond)
	//timeSecond := 1630312077
	eventReq := EventReq{
		CompanyId:  250,
		CompanyKey: "38I14Tifq5pMX0RH",
		Platform:   "9",
		SignTime:   timeSecond,
		Pics: []string{
			"data:image/png;base64,",
		},
		AddressInfo: AddressInfo{
			Location: "",
			Lng:      "114.546884",
			Lat:      "30.498393",
		},
		Content:   "",
		Level:     "",
		EventType: "",
	}
	marshal, _ := json.Marshal(eventReq.Pics)
	signStr := Sign(&eventReq, timeSecond)

	data := url.Values{}
	data.Set("com_id", strconv.Itoa(250))
	data.Set("com_key", "38I14Tifq5pMX0RH")
	data.Set("address", "{\"lat\":\"30.498393\",\"lng\":\"114.546884\",\"location\":\"\"}")
	data.Set("content", "")
	data.Set("event_type_name", "")
	data.Set("level_name", "")
	data.Set("signtime", strconv.Itoa(timeSecond))
	data.Set("sign", signStr)
	data.Set("pics", string(marshal))

	eventReq.Sign = signStr
	URL := "http://zf.zftest.xbcx.com.cn/wq/openapi/task/collect/report"
	headMap := map[string]string{
		"Content-Type": "application/x-www-form-urlencoded",
	}
	fmt.Println(data)
	req, _ := http.NewRequest("POST", URL, strings.NewReader(data.Encode()))
	for k, v := range headMap {
		req.Header.Set(k, v)
	}
	client := &http.Client{}
	resp, err := client.Do(req)
	if err != nil {
		panic(err)
	}
	defer resp.Body.Close()

	body, _ := ioutil.ReadAll(resp.Body)
	decode, _ := unicodeDecode(body)
	fmt.Println("response Body:", string(decode))

}
